Baby Got Boobs - Christie Stevens (Boobie Broker)

Christie has always wanted a chance to join the family real estate business, and today she is finally going to get the opportunity to sell her first house! Not wanting to screw it up, Christie pulls out all the stops. She'll do anything to convince Mick to sign on the dotted line. Hell, she's even willing to fuck his brains out in every room if it convinces him to buy, which is exactly what she does. In today's housing market, you've really gotta whore yourself out to make a sale.
